description:
Get three best-selling puzzle games in one! Embark on an adventurous journey around the ancient lands of the Mediterranean in search of the legendary continent of Atlantis. Find a way to bring the Lost Continent back to the surface. Acquire seven mysterious crystals of power to be able to restore the Altar of Poseidon and save the fabled sunken city.  Be the hero the world seeks to unravel the mystery of all times!

